import React, { Component } from 'react'
import { Link } from "react-router-dom";
import './ServiceContentList'



export default class megaServiceItem extends Component {
	render() {
		return (
			<>
				<div className="dropdown-menu" aria-labelledby="navbarDropdown">
					<div className="container common-container-wdt">
						<div className="service-fl-box">
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemfisrt}</h4>
									<ul>
									{ ServiceItem.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemSec}</h4>
									<ul>
									{ ServiceItemApp.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemthird}</h4>
									<ul>
									{ ServiceItemTech.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemfisrt}</h4>
									<ul>
									{ ServiceItem.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemfisrt}</h4>
									<ul>
									{ ServiceItem.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
							<div className="service-box">
								<div className='prd-services-content'>
									<h4>{headItemfisrt}</h4>
									<ul>
									{ ServiceItem.map((element) => {
										return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
									})}
									</ul>
								</div>
							</div>
						</div>
					</div>
				</div>
			</>
		)
	}
}
